import React from 'react';
import './WhatIdo.css';

const WhatIdo = (props) => {
    return (
      <div className="what-I-do" style = 'background-color: var(--color-yellow-light);'>
        <div className='what-I-do__text'> 
          <h4  className='what-I-do__text-small-title'> {props.smallTitle} </h4>
          <h2  className='what-I-do__text-big-title'>   {props.bigTitle1} </h2>
          <h2  className='what-I-do__text-big-title'>   {props.bigTitle2} </h2>
          <div  className = 'what-I-do__text-paragraph'>
            <p> {props.paragraph} </p>
          </div>
        </div>

        <img src={props.picture} className="what-I-do__picture"/>
      </div>
    );
}

export default WhatIdo;
